import '../../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import '../../../assets/css/project/projects_common_style.css';

const Project = () =>{
    return(
        <div style={{color:"#fff"}}>
        <div className="project_head">
            <div className="porject_info">
             <span >Project Info</span>
            </div>
            <div className="porject_more_info">
                <span><b>Date:</b>07.21.2021</span>
                <span><b>Category:</b>Web Development</span>
                <span><b>Client</b> Biba Trading</span>
            </div>
        </div>
        </div>
    )
}
export default Project;
